// Get the JKS keypair for signing the JWT

String prodaOrgId = context.testCase.testSuite.getPropertyValue("prodaId")
String deviceName = context.testCase.testSuite.getPropertyValue("deviceName");
String authMode = context.testCase.testSuite.getPropertyValue("authMode");
String audience = context.testCase.testSuite.getPropertyValue("audience");
log.info(prodaOrgId);
log.info(deviceName);
log.info(authMode);

def key

if (authMode.toUpperCase() == 'JKS')
{
     String certLocation = context.testCase.testSuite.getPropertyValue("certLocation");

	def containerPassword = "Pass-123";
	def aliasPassword = "Pass-123";
	def alias = "proda-alias";
	def file = new File(certLocation);
	def is = new FileInputStream(file);
	log.info(is);
	def keystore = KeyStore.getInstance(KeyStore.getDefaultType());
	keystore.load(is, containerPassword.toCharArray());
	key = keystore.getKey(alias, aliasPassword.toCharArray());  
	if(key==null) {
		key = keystore.getKey("1", aliasPassword.toCharArray());  
	}
	is.close();  
}
else
{
	String certLocation = context.testCase.getPropertyValue("certLocation");
     def containerPassword = "Pass-123";
	def alias = "1";
	def keyStore = KeyStore.getInstance("pkcs12");
	def aliasPassword = containerPassword;
	def file = new File(certLocation);
	def is = new FileInputStream(file);
	log.info(is);
	keyStore.load(is, containerPassword.toCharArray());
	key = keyStore.getKey(alias, aliasPassword.toCharArray());
	is.close();
}



